script: |
  super -f text -I q13646.spq | sort > q13646.out

inputs:
  - name: q13646.spq
    data: |
      SELECT ALL - - col1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 39 NOT IN ( - col1 + - - col1, - 46 / - col2 + + - col1 + + - 79, - col2, col2, + 13 + - 6, - ( col1 ), - 56, - 21, col1 * - + 46 + + CAST ( + + ( + - col1 ) AS INTEGER ) );
  - name: tab1

outputs:
  - name: q13646.out
    data: |
